import React from "react";

function ErrorModal(props) {
  return (
    <div>
      <div className="modal">
        <div className="bg-dark fs-2">{props.title}</div>
        <div className="bg-light fs-4">{props.message}</div>
        <button onClick={onCon}>Okay</button>
      </div>
    </div>
  );
}

export default ErrorModal;
